const fs = require('fs');
const path = require('path');

function decodeBase64ToFile(base64Data) {
  // Extract the file extension from the base64 string
  const extensionMatch = base64Data.match(/^data:(.+);base64,/);
  const extension = extensionMatch ? `.${extensionMatch[1].split('/')[1]}` : '';

  // Decode the base64 data
  const decodedData = Buffer.from(base64Data.replace(/^data:.+;base64,/, ''), 'base64');

  // Save the decoded data to a file with the appropriate extension
  const fileName = `decoded${extension}`;
  fs.writeFileSync(fileName, decodedData);

  console.log(`File saved as ${fileName}`);
}

// Usage example
const base64Data ="data:application/pdf;base64,"; 
decodeBase64ToFile(base64Data);
